import React from 'react';

import Card from '../UI/Card';
import classes from './DataList.module.css';

const DataList = props => {
    return (
    <Card className={classes.users}>
        <ul>
            {props.datas.map(data => 
                <li key={data.id}>
                    {data.subject}
                    {data.grade}
                    {data.credit}
                </li>
            )}
        </ul>
    </Card>

    )
};

export default DataList
